import React from 'react';
import classes from './Header.module.css';

function Header() {
  return (
    <header className={classes.header}>
      <div className={classes.logo}>AM/NS India</div>
      <nav>
        <ul>
          <li>Company</li>
          <li>Portfolio</li>
          <li>Products</li>
          <li>People</li>
          <li>Society</li>
          <li>Newsroom</li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
